// FilmForm.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';

const FilmForm = () => {
    const [newFilm, setNewFilm] = useState({
        title: '',
        director: '',
        durationMinutes: 0,
        watched: false,
        releaseDate: '',
        rating: 0.0,
        popularity: 0.0,
    });
    const [editingFilm, setEditingFilm] = useState(null); // Film do edycji
    const { id } = useParams(); // Zmienna ID filmu z URL
    const navigate = useNavigate(); // Zastąpione useHistory przez useNavigate

    useEffect(() => {
        if (id) {
            const fetchFilm = async () => {
                try {
                    const response = await axios.get(`http://localhost:8080/films/${id}`);
                    setEditingFilm(response.data);
                    setNewFilm(response.data);
                } catch (error) {
                    console.error('Błąd podczas pobierania filmu', error);
                }
            };
            fetchFilm();
        }
    }, [id]);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setNewFilm((prevFilm) => ({
            ...prevFilm,
            [name]: value,
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            if (editingFilm) {
                const response = await axios.put(`http://localhost:8080/films/${editingFilm.id}`, newFilm);
                navigate('/'); // Zastąpienie history.push przez navigate
            } else {
                const response = await axios.post('http://localhost:8080/films', newFilm);
                navigate('/'); // Zastąpienie history.push przez navigate
            }
        } catch (error) {
            console.error('Błąd podczas zapisywania filmu', error);
        }
    };

    return (
        <div>
            <h2>{editingFilm ? 'Edytuj Film' : 'Dodaj Film'}</h2>
            <form onSubmit={handleSubmit}>
                <label>
                    Tytuł:
                    <input
                        type="text"
                        name="title"
                        value={newFilm.title}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Reżyser:
                    <input
                        type="text"
                        name="director"
                        value={newFilm.director}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Czas trwania (minuty):
                    <input
                        type="number"
                        name="durationMinutes"
                        value={newFilm.durationMinutes}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Obejrzany:
                    <input
                        type="checkbox"
                        name="watched"
                        checked={newFilm.watched}
                        onChange={(e) =>
                            setNewFilm((prev) => ({
                                ...prev,
                                watched: e.target.checked,
                            }))
                        }
                    />
                </label>
                <br />
                <label>
                    Data wydania:
                    <input
                        type="date"
                        name="releaseDate"
                        value={newFilm.releaseDate}
                        onChange={handleInputChange}
                        required
                    />
                </label>
                <br />
                <label>
                    Ocena:
                    <input
                        type="number"
                        name="rating"
                        value={newFilm.rating}
                        onChange={handleInputChange}
                        step="0.1"
                        min="0"
                        max="10"
                        required
                    />
                </label>
                <br />
                <label>
                    Popularność:
                    <input
                        type="number"
                        name="popularity"
                        value={newFilm.popularity}
                        onChange={handleInputChange}
                        step="0.1"
                        min="0"
                        required
                    />
                </label>
                <br />
                <button type="submit">{editingFilm ? 'Zapisz zmiany' : 'Dodaj film'}</button>
            </form>
        </div>
    );
};

export default FilmForm;
